    false,nt"url": null,nt"notes": "This is a summary on an initial meeting
    to discuss (1) how the biological workshops will be conducted , (2) tentatively
    agree on the expected outcome of the workshops, and (3) to determine information
    needs prior to the first workshop for the Souris River Loop National Wildlife Refuges,
    which are Des Lacs National Wildlife Refuge, J. Clark Salyer National Wildlife Refuge,
    and Upper Souris National Wildlife Refuge.  The meetings took place November 12-14,
    2002 and are part of the Comprehensive Conservation Plan planning.",nt"license_title":
